import React, { useState } from 'react';
import InputNumber from './InputNumber';
import NameGenerator from './NameGenerator';
import GenderSelector from './GenderSelector';
import RaceSelector from './RaceSelector';

function App() {
  const [numNames, setNumNames] = useState(1);

  const handleNumNamesChange = (newValue) => {
    setNumNames(newValue);
  };

  return (
    <div>
      <h1>D&D Character Name Generator</h1>
      <InputNumber onChange={handleNumNamesChange} />
      <GenderSelector />
      <RaceSelector />
      <NameGenerator numNames={numNames} />
    </div>
  );
}

export default App;
